import React from "react";

function Checkout(props) {
  return (
    <div className="checkout-container">
      <div>
        <img src="#" alt="alt" />
        <p>Item Description</p>
        <p>Item Price</p>
        <button>Remove button</button>
      </div>
      <div>
        <h2>Total</h2>
        <h3>Tax</h3>
        <h3>quantity</h3>
        <button>PAY</button>
      </div>
    </div>
  );
}

export default Checkout;
